export default function Button(props) {
  const isClear = true
  return(
    <button onclick={this.props.onClick} className={isClear ? "clear-button" : "black-button"}>
      <a className="title">{props.children}</a>
      <div className="button-clear"/>
      <style jsx>{`
        .clear-button{
          background: white
        }
        .black-button{
          background: black
        }
        `}</style>
    </button>
  )
}
